import './App.css';
import Welcome from './components/welcome';
import Home from './components/Home'
import React from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
} from "react-router-dom";

function App() {
  return (
    <div className="app">
      <Router>
        <Routes>
          <Route path='/' element={<Home />} />
          <Route path='/login' element={<Welcome />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
